import React from "react";
import { Link } from "react-router-dom";

const SideBar = () => {
  return (
    <div>
      <div className="fixed z-50 flex w-16 h-screen overflow-hidden bg-white">
        <div className="absolute z-50 cursor-pointer w-fit h-fit">
          <ul class="text-2xl flex flex-col gap-1 cursor-pointer text-center">
            <Link to={"/"}>
              <li class="fa-solid fa-house"></li>
            </Link>
            <Link to={"/education"}>
              <li class="fa-solid fa-book "></li>
            </Link>
            <Link to={"/projects"}>
              <li class="fa-solid fa-laptop-file "></li>
            </Link>
            <Link to={"/contact"}>
              <li class="fa-solid fa-headset "></li>
            </Link>
            <Link to={"/progress"}>
              <li class="fa-solid fa-bars-progress "></li>
            </Link>
          </ul>
        </div>
      </div>
    </div>
  );
};

export default SideBar;
